import React from 'react';
import { Carousel } from 'antd'; 

const items = [
    {
        key:'1',
        title:'welcome to be routine management',
        content:'1st page of the routine management',
    },
    {
        key:'2',
        title:'create the interactive routine here',
        content:'2nd page of the routine management',
    },
    {
        key:'3',
        title:'say bye bye to the manual tedious working sessions',
        content:'3rd page of the routine management',
    },
]

function AppHero() {
    return(
        <div className = "heroBlock">
  <Carousel>
      {items.map(item => {
         return(
           <div className = "container-fluid">
               <div className = "content">
                   {item.content}
               </div>
            </div>
         );
      })}
  </Carousel>
        </div>
    );
}

export default AppHero;
